import React from 'react';
import {
    Container, 
    MenuIconMaterial,
    MenuIconYoutube,
    YoutubeImage
} from './styled';

// Importação dos icones da biclioteca
import MenuIcon from '@material-ui/icons/Menu';

export default () => {
    return(
        <Container>
            <MenuIconMaterial>
                <MenuIcon />
            </MenuIconMaterial>
            <MenuIconYoutube>
                <YoutubeImage  src="../../../../images/youtube.png" alt="Youtube"/>
            </MenuIconYoutube>
        </Container>
    );
}
